import React from "react";
import "cardStyle";

function Card(props) {
  return (
    <div className={`card ${props.float}`} key={props.uniqueKey}>
      <div className="gif">
        <iframe
          src={props.url}
          style={{
            width: "100%",
            height: "90%",
            border: "none",
          }}
          className="giphy-embed"
        ></iframe>
      </div>
      <h2 className="name">{props.name}</h2>
    </div>
  );
}

export default Card;
